function InputNote(props){

    function add(event){
        event.preventDefault();
        props.add("titl e is here","content is here");
    }

    return (
        <div>
            <form>
                <input placeholder="Tilte"/>
                <textarea placeholder="Content"/>
                <button onClick= {add}>ADD</button>
            </form>
        </div>
    );
}

export default InputNote
